import React from 'react';
import ReactDOM from 'react-dom';

class MenuItem extends React.Component {
  render() {
    return(
      //normal right menu item
     (this.props.item.level == 1)?
        (
          <li className={this.props.item.cItem}>
            <a className="{this.props.item.cLink}" href="{this.props.item.url}">
            <i className="{this.props.item.icon}"></i>
              {this.props.item.title}
            </a>
          </li>
        ):
      //dropdown menu item
      (
          <li className="{this.props.item.cItem}">
            <a className="{this.props.item.cLink}" data-toggle="dropdown" href="#">
              {this.props.item.title}
              <span className="caret"></span>
            </a>
            <ul className="dropdown-menu text-right pr-2">
              <li><a href="#">ציפורניים</a></li>
              <li><a href="#">איפור</a></li>
              <li><a href="#">הרמת ריסים</a></li>
              <li><a href="#">עיצוב גבות</a></li>
              <li><a href="#">פדיקור רפואי</a></li>
              <li><a href="#"> אופנה</a></li>
              <li><a href="#">עיצוב צמות</a></li>
              <li><a href="#">נרות הופי</a></li>
              <li><a href="#"> עיסוי רפואי</a></li>
            </ul>
          </li>
      )
    );
  }
}

export default MenuItem
